import React, { Component } from 'react';

class Nav extends Component {
  render() {
    return(
      <nav className='buttons col-12'>
        <ul className='row' style={{listStyle: 'none'}}>
          <li className='col'>
            <span class="iconify" data-icon="ant-design:plus-square-filled" style={{fontSize: '2em'}} data-inline="false"></span>
          </li>
          <li className='col'>
            <span class="iconify" data-icon="whh:foodtray" data-inline="false"></span>
          </li>
        </ul>
      </nav>
    )
  }
}

export default Nav;
